sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  if(inputs.status_code == 200){

    var obj = JSON.parse(inputs.response_body);

    outputs.hostname = obj.hostname;
    outputs.city = obj.city;
    outputs.region = obj.region;
    outputs.country = obj.country;

    var loc = obj.loc.split(',');
    outputs.latitude = loc[0];
    outputs.longitude = loc[1];
  }

})(inputs, outputs);

